import './App.css'; // Main CSS file for the entire app
import AdBanner from './jsx/AdBanner/AdBanner';
import Navigation from './jsx/nav/Navigation';

const App = () => {
  return (
    <div className="apps">
      <AdBanner />
      <Header />
      <Navigation />
      <div className="app">
      <main className="main-content">

        <div className='grid'>
        <FeaturedArticles />
        <forYou />
        <Latestgrid />
        </div>
      </main>
      </div>
      <Footer />
    </div>
  );
};

export default App;
